import "./Responsive.scss";
import "./Login.scss";
import setCookie from "universal-cookie";

import AuthService from "../service/auth-service";
import { Col, Row, Button, Checkbox, Form, Input } from "antd";
import { LoginOutlined } from "@ant-design/icons";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import { useCookies } from "react-cookie";


  interface LoginFormState {
    email: string;
    password: string;
  }
  
  const LoginForm = () => {
    const navigate = useNavigate();
    const [formState, setFormState] = useState<LoginFormState>({ email: '', password: '' });
    const [error, setError] = useState<string>('');
  
    const handleInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
      setFormState({ ...formState, [event.target.name]: event.target.value });
    };
  
    const handleLogin = async (event: React.FormEvent<HTMLFormElement>) => {
      event.preventDefault();
      try {
        await AuthService.login(formState.email, formState.password);
        navigate('/');
      } catch (error) {
        setError('Invalid email or password');
      }
    };
  return (
    <div className="App">
      <Row style={{ height: "100%" }}>
        <Col span={12} xs={24} sm={12}>
          <div className="register register-left">
            <div className="title">
              <img
                src="https://cdn.haitrieu.com/wp-content/uploads/2022/06/Logo-Thanh-Pho-Da-Nang.png"
                alt="logo DA NANG city"
              />
              <h2>KHO KẾT QUẢ THỦ TỤC HÀNH CHÍNH SỐ</h2>
            </div>

            <Form
              name="basic"
              labelCol={{ span: 24 }}
              wrapperCol={{ span: 0 }}
              style={{ maxWidth: 600 }}
              initialValues={{ remember: true }}
              onFinish={onFinish}
              onFinishFailed={onFinishFailed}
              autoComplete="off"
            >
              <Form.Item
                label="Tên đăng nhập"
                name="username"
                rules={[
                  { required: true, message: "Vui lòng nhập tên đăng nhập!" },
                ]}
              >
                <Input onChange={(e) => setEmail(e.target.value)} />
              </Form.Item>

              <Form.Item
                label="Mật khẩu"
                name="password"
                rules={[{ required: true, message: "Vui lòng nhập mật khẩu!" }]}
              >
                <Input.Password onChange={(e) => setPassword(e.target.value)} />
              </Form.Item>

              <Form.Item
                name="remember"
                valuePropName="checked"
                wrapperCol={{ offset: 0, span: 11 }}
              >
                <Checkbox>Remember me</Checkbox>
              </Form.Item>

              <Form.Item wrapperCol={{ offset: 0, span: 0 }}>
                <Button
                  type="primary"
                  htmlType="submit"
                  style={{ width: "100%" }}
                >
                  <LoginOutlined />
                  Đăng nhập
                </Button>
              </Form.Item>
              <Form.Item wrapperCol={{ offset: 0, span: 0 }}>
                <Button
                  htmlType="submit"
                  style={{
                    width: "100%",
                    backgroundColor: "#ff8f18",
                  }}
                  type="primary"
                  onClick={isLogin}
                >
                  Đăng nhập bằng tài khoản công dân số
                </Button>
              </Form.Item>
            </Form>
          </div>
        </Col>
        <Col span={12} xs={24} sm={12} className="col-right">
          <div className="register register-right"></div>
        </Col>
      </Row>
    </div>
  );
}

export default Login;
